import '../index.css';
import React, { useEffect, useState,  Component }  from 'react';
import { Link } from "react-router-dom";



function Home() {
  let [object, setObject] = useState({
    name: "",
    id: ""
  });



  return (

    <div className="flex justify-center">
      <div className="bg-pink-200 mt-8 p-3 text-center border-yellow-200 border-8 rounded-lg">
        <div className="flex justify-center">
        <p>
          Name:  
        </p>
        <input
          value={object.name}
          onChange={e => setObject({
            name: e.target.value
          })}
        />
        </div>
        <Link to="/quiz/43554">
          Hello
        </Link>
      </div>
    </div>
  )
}

export default Home;
